import React from 'react';
import mockListings from '../assets/mocklisting'; // Import the mockListings data

const ListingDetail = () => {
  const url = window.location.href;
  const parts = url.split("/");
  const id = parts[3];

  const listing = mockListings.find((item) => item.id === parseInt(id, 10));

  if (!listing) {
    return <div>{'Listing with ID ${id} not found'}</div>;
  }

  return (
    <div>
        <Listing
            key={listing.id}
            imageUrl={listing.imageUrl}
            title={`Stay with ${listing.hostName}`}
            hostName={`Host: ${listing.hostName}`}
            description={listing.description}
            bedType={listing.bedType}
            price={listing.price}
            id={listing.id}
          />
    </div>
  );
};

export default ListingDetail;
